jQuery(document).ready(function ($) {


    $('[name="phone"], [name="telephone"]').mask('+38 (999) 999-99-99', {
            //placeholder: "+38 (0__) ___-__-__",
            onComplete: function (e, b) {

            }
        }
    );

    $("#order-form").validate({
        ignore: [],
        rules: {
            firstname: {
                required: true
            },
            lastname: {
                required: true
            },
            telephone: {
                required: true,
            },
            address: {
                required: true,
            },
            courier: {
                required: true,
            },
            email: {
                email: true
            }
        },
        messages: {
            firstname: {
                required: " '",
            },
            lastname: {
                required: " ",
            },
            telephone: {
                required: "     380.........",
            },
            email: {
                email: "    "
            },
            address: {
                required: "  ",
            },
            courier: {
                required: "    ",
            },
        },
        submitHandler: function (form) {
            if ($('[name="payment_method"]:checked').val() != 'bank_transfer') {

                var $form = $(form);

                $form.find('.error-msg').remove();

                $.ajax({
                    url: 'index.php?route=checkout/final',
                    type: 'post',
                    data: $form.serialize(),
                    dataType: 'json',
                    success: function (json) {
                        if (json['payment']) {
                            $('#payments').html(json['payment']);
                            var $gatewayLink = $('#payments').find(".buttons a:last");
                            var $submitButton = $('#payments').find(".buttons input[type=button]:last,.buttons input[type=submit]:last,.buttons input[type=image]:last,.buttons button:last,.buttons a.button:last[href='#'],.buttons a.btn:last[href='#'],.buttons a.button:last[href^='javascript'],.buttons a.btn:last[href^='javascript'],.buttons a.button:last:not([href]),.buttons a.btn:last:not([href])");
                            var $lastButton = $('#payments').find("input[type=button]:last,input[type=submit]:last,input[type=image]:last,button:last");
                            var $lastLink = $('#payments').find("a:last");

                            var $obj = false;

                            if ($gatewayLink.length) {
                               $obj = $gatewayLink;
                            } else if ($submitButton.length) {
                                $obj = $submitButton;
                            } else if ($lastButton.length) {
                                $obj = $lastButton;
                            } else if ($lastLink.length) {
                                $obj = $lastLink;
                            }
                            $obj.click();
                        } 
                    },
                    error: function (xhr, ajaxOptions, thrownError) {
                        alert(thrownError + "\r\n" + xhr.statusText + "\r\n" + xhr.responseText);
                    }
                });
            } else {
                console.log('111');
                form.submit();
            }
        }
    });


    $('#send-request-form, #send-call-form').validate({
        ignore: [],
        rules: {
            firstname: {
                required: true
            },
            telephone: {
                required: true,
            }
        },
        messages: {
            firstname: {
                required: " '",
            },
            telephone: {
                required: "     380.........",
            }
        },
        submitHandler: function (form) {
            var $form = $(form);

            $form.find('.error-msg').remove();

            $.ajax({
                url: 'index.php?route=checkout/final/sendBitrixCRMAjax',
                type: 'post',
                data: $form.serialize(),
                //dataType: 'json',
                beforeSend: function () {

                },
                complete: function () {

                },
                success: function (json) {

                    if (json['error']) {

                    } else {

                        $form.addClass('success');
                        $form.find('label.error').remove();

                        $form.slideUp("slow", function () {
                            $form.after('<div class="modal-text-succses">' + json['success'] + '</div>');
                        });


                        if ($form.hasClass('send-request-form')) {

                            fbq('track', 'Purchase', {
                                content_type: 'product',
                                content_ids: [$form.find('input[name="request_product_id"]').val()],
                                num_items: 1,
                                value: $form.find('input[name="request_total"]').val(),
                                currency: 'UAH'
                            });
                        } else {
                            fbq('track', 'Purchase');
                        }

                        location.href = 'https://4loft.com.ua/thanksforlead'


                    }
                },
                error: function (xhr, ajaxOptions, thrownError) {
                    alert(thrownError + "\r\n" + xhr.statusText + "\r\n" + xhr.responseText);
                }
            });
        }
    });


});


